import React from 'react'

function Teams({ data }) {
    console.log(data)
    return (
        <div className=''>
            {data?.map(team =>{
            return(
                <div key ={team.id}>
                <p>{team.college_name}</p>
                <img src={team.id_card} alt="idCard"/>
                <img src={team.payment_screenshot} alt="Paymentproof"/>
                </div>
            )
        })}</div>
    )
}

export default Teams
